import { httpAction } from '@/api/manage';
import pick from 'lodash.pick';
import moment from "moment";
import JSelectUserByDepSingle from "../../../components/jeecgbiz/JSelectUserByDepSingle";
export default {
  name: "SysUserAgentModal",
  components: {
    JSelectUserByDepSingle: JSelectUserByDepSingle
  },
  data: function data() {
    return {
      title: "操作",
      visible: false,
      model: {},
      labelCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 5
        }
      },
      wrapperCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 16
        }
      },
      confirmLoading: false,
      form: this.$form.createForm(this),
      validatorRules: {},
      url: {
        add: "/sys/sysUserAgent/add",
        edit: "/sys/sysUserAgent/edit"
      },
      //****************************************
      checkedDepartKeys: []
    };
  },
  created: function created() {},
  methods: {
    onSearch: function onSearch() {
      this.$refs.SelectDepartWindow.add(this.checkedDepartKeys, this.userId);
    },
    add: function add() {
      this.edit({});
    },
    edit: function edit(record) {
      var _this = this;

      this.form.resetFields();
      this.model = Object.assign({}, record);
      this.visible = true;
      this.$nextTick(function () {
        _this.form.setFieldsValue(pick(_this.model, 'userName', 'agentUserName', 'status', 'createName', 'updateName', 'sysOrgCode', 'sysCompanyCode')); //时间格式化


        _this.form.setFieldsValue({
          startTime: _this.model.startTime ? moment(_this.model.startTime) : null
        });

        _this.form.setFieldsValue({
          endTime: _this.model.endTime ? moment(_this.model.endTime) : null
        });
      });
    },
    close: function close() {
      this.$emit('close');
      this.visible = false;
    },
    handleOk: function handleOk() {
      var _this2 = this;

      var that = this; // 触发表单验证

      this.form.validateFields(function (err, values) {
        if (!err) {
          that.confirmLoading = true;
          var httpurl = '';
          var method = '';

          if (!_this2.model.id) {
            httpurl += _this2.url.add;
            method = 'post';
          } else {
            httpurl += _this2.url.edit;
            method = 'put';
          }

          var formData = Object.assign(_this2.model, values); //时间格式化

          formData.startTime = formData.startTime ? formData.startTime.format('YYYY-MM-DD HH:mm:ss') : null;
          formData.endTime = formData.endTime ? formData.endTime.format('YYYY-MM-DD HH:mm:ss') : null;
          console.log(formData);
          httpAction(httpurl, formData, method).then(function (res) {
            if (res.success) {
              that.$message.success(res.message);
              that.$emit('ok');
            } else {
              that.$message.warning(res.message);
            }
          }).finally(function () {
            that.confirmLoading = false;
            that.close();
          });
        }
      });
    },
    handleCancel: function handleCancel() {
      this.close();
    }
  }
};
